 List<LanguageVersion> parseTable() {
    final document = parse(html);
    final table = document.querySelector('table');
    final rows = table?.querySelectorAll('tr');

    final languageVersions = <LanguageVersion>[];

    for (final row in rows!) {
       final cells = row.querySelectorAll('td');

       if (cells.length < 5) {
          continue;
       }

       final map = {
          'S No.': int.parse(cells[0].text),
          'Languages': cells[1].text,
          'Language Code': cells[2].text,
          'Versions': cells[3].text,
          'Version Index': int.parse(cells[4].text),
       };

       languageVersions.add(LanguageVersion.fromMap(map));
    }

    return languageVersions;
 }

}
class LanguageVersion {
   final int sNo;
   final String language;
   final String languageCode;
   final String version;
   final int versionIndex;

   LanguageVersion({
      required this.sNo,
      required this.language,
      required this.languageCode,
      required this.version,
      required this.versionIndex,
   });

   factory LanguageVersion.fromMap(Map<String, dynamic> map) {
      return LanguageVersion(
         sNo: map['S No.'] as int,
         language: map['Languages'] as String,
         languageCode: map['Language Code'] as String,
         version: map['Versions'] as String,
         versionIndex: map['Version Index'] as int,
      );
   }
}